// n8n Function node
// Input: array of enrichment results (email, phone, none)
// Output: single normalized lead object

return [
  {
    json: (() => {
      // Merge all records into one object
      const all = items.map(i => i.json);

      const base = all[0]; // take the first as default since all share same name/company

      // Find best email (from enrichment_level=email or from emails array)
      const emailRecord = all.find(r => r.email) || {};
      const email = emailRecord.email || (emailRecord.emails?.[0]?.email) || null;

      // Find best phone
      const phoneRecord = all.find(r => r.phone_number) || {};
      const phone = phoneRecord.phone_number || (phoneRecord.phones?.[0]?.number) || null;

      return {
        first_name: base.name?.split(" ")[0] || null,
        last_name: base.name?.split(" ").slice(1).join(" ") || null,
        email: email,
        phone_number: phone,
        company_name: base.company || null,
        website: base.company_domain || null,
        location: base.location || null,
        job_title: base.title || null,
        linkedin_profile: base.linkedin_profile_url || null,
        company_url: base.company_domain || null
      };
    })()
  }
];
